(1, 'Terms & Conditions', 'terms-conditions', 'published', '<p>Welcome to SkyBooking. These Terms and Conditions (\"Terms\") govern your use of our website, mobile applications, and related services (collectively, the \"Service\") operated by SkyBooking Private Limited (\"we,\" \"us,\" or \"our\").</p><p>By accessing or using our Service, you agree to be bound by these Terms. If you disagree with any part of these terms, then you may not access the Service.</p><h2><strong>1. Acceptance of Terms</strong></h2><p>By creating an account, making a booking, or otherwise using SkyBooking\'s services, you acknowledge that you have read, understood, and agree to be bound by these Terms and our Privacy Policy.</p><h3><strong>1.1 Eligibility</strong></h3><p>You must be at least 18 years old to use our services. By using our Service, you represent and warrant that you meet this age requirement.</p><h3><strong>1.2 Modifications</strong></h3><p>We reserve the right to modify these Terms at any time. We will notify users of significant changes via email or through our platform. Continued use of our services after changes constitutes acceptance of new terms.</p><h2><strong>2. Services Description</strong></h2><p>SkyBooking provides an online platform for searching, comparing, and booking travel services including flights, hotels, and related travel products.</p><h3><strong>2.1 Platform Services</strong></h3><ul><li>Flight search and booking services</li><li>Hotel accommodation booking</li><li>Travel package arrangements</li><li>Travel insurance options</li><li>Customer support services</li></ul><h3><strong>2.2 Third-Party Services</strong></h3><p>We act as an intermediary between you and travel service providers (airlines, hotels, etc.). The actual travel services are provided by third parties, and separate terms may apply.</p><h2><strong>3. User Accounts</strong></h2><h3><strong>3.1 Account Creation</strong></h3><p>To access certain features, you must create an account with accurate and complete information. You are responsible for maintaining the confidentiality of your account credentials.</p><h3><strong>3.2 Account Security</strong></h3><ul><li>Choose a strong, unique password</li><li>Do not share your login credentials</li><li>Notify us immediately of any unauthorized access</li><li>You are responsible for all activities under your account</li></ul><h3><strong>3.3 Account Information</strong></h3><p>You agree to provide accurate, current, and complete information and to update such information to maintain its accuracy.</p><h2><strong>4. Booking Terms</strong></h2><h3><strong>4.1 Booking Process</strong></h3><p>When you make a booking through our platform, you enter into a contract with the relevant service provider (airline, hotel, etc.) subject to their terms and conditions.</p><h3><strong>4.2 Booking Confirmation</strong></h3><p>Bookings are confirmed only when you receive a confirmation email from us. We reserve the right to cancel bookings that cannot be confirmed with service providers.</p><h3><strong>4.3 Pricing and Availability</strong></h3><ul><li>Prices are subject to change until booking is confirmed</li><li>All prices include applicable taxes unless stated otherwise</li><li>Availability is subject to real-time inventory</li><li>Promotional prices may have specific terms and restrictions</li></ul><h3><strong>4.4 Travel Documents</strong></h3><p>You are responsible for ensuring you have valid travel documents (passport, visa, etc.) required for your journey. We are not liable for any issues arising from inadequate documentation.</p><h2><strong>5. Payment Terms</strong></h2><h3><strong>5.1 Payment Methods</strong></h3><p>We accept major credit cards, debit cards, and other payment methods as displayed during checkout. All payments are processed securely through our certified payment partners.</p><h3><strong>5.2 Service Fees</strong></h3><p>We may charge service fees for certain bookings. All applicable fees will be clearly displayed before you complete your booking.</p><h3><strong>5.3 Currency and Exchange Rates</strong></h3><p>Prices may be displayed in multiple currencies. Exchange rates are updated regularly but final charges may vary based on your payment method and bank.</p><h2><strong>6. Cancellation &amp; Refunds</strong></h2><h3><strong>6.1 Cancellation Policy</strong></h3><p>Cancellation policies vary by service provider and fare type. Refund eligibility and processing times depend on the specific terms of your booking.</p><h3><strong>6.2 Refund Process</strong></h3><ul><li>Refund requests must be submitted through our platform</li><li>Processing time varies from 5-15 business days</li><li>Refunds are processed to the original payment method</li><li>Service fees may be non-refundable</li></ul><h3><strong>6.3 Force Majeure</strong></h3><p>In cases of extraordinary circumstances (natural disasters, political unrest, pandemics), special cancellation and refund policies may apply as determined by service providers.</p><h2><strong>7. Liability &amp; Disclaimers</strong></h2><h3><strong>7.1 Service Limitations</strong></h3><p>SkyBooking acts as an intermediary platform. We are not responsible for the quality, safety, or legality of services provided by third-party vendors.</p><h3><strong>7.2 Limitation of Liability</strong></h3><p>Our liability is limited to the amount paid for services through our platform. We are not liable for indirect, incidental, or consequential damages.</p><h3><strong>7.3 Travel Risks</strong></h3><p>You acknowledge that travel involves inherent risks and agree to travel at your own risk. We recommend purchasing appropriate travel insurance.</p><h2><strong>8. User Conduct</strong></h2><h3><strong>8.1 Prohibited Activities</strong></h3><p>You agree not to:</p><ul><li>Use the service for any unlawful purpose</li><li>Impersonate others or provide false information</li><li>Interfere with or disrupt the service</li><li>Attempt to gain unauthorized access to our systems</li><li>Use automated systems to access our service</li></ul><h3><strong>8.2 Content Guidelines</strong></h3><p>Any content you submit (reviews, comments) must be accurate, respectful, and comply with our community guidelines.</p><h2><strong>9. Intellectual Property</strong></h2><h3><strong>9.1 SkyBooking Content</strong></h3><p>All content on our platform, including text, graphics, logos, and software, is owned by SkyBooking and protected by intellectual property laws.</p><h3><strong>9.2 User License</strong></h3><p>We grant you a limited, non-exclusive license to access and use our platform for personal, non-commercial purposes.</p><h3><strong>9.3 Restrictions</strong></h3><p>You may not copy, modify, distribute, or create derivative works from our content without explicit permission.</p><h2><strong>10. Privacy Policy</strong></h2><p>Your privacy is important to us. Our Privacy Policy explains how we collect, use, and protect your personal information. By using our service, you consent to our privacy practices.</p><h4><strong>Privacy Policy</strong></h4><p>For detailed information about how we handle your data, please review our complete Privacy Policy.</p><h2><strong>11. Termination</strong></h2><h3><strong>11.1 Termination by User</strong></h3><p>You may terminate your account at any time by contacting our customer support or through your account settings.</p><h3><strong>11.2 Termination by SkyBooking</strong></h3><p>We reserve the right to suspend or terminate accounts that violate these Terms or engage in fraudulent activities.</p><h3><strong>11.3 Effect of Termination</strong></h3><p>Upon termination, your right to use the service ceases, but existing bookings remain valid subject to their respective terms.</p><h2><strong>12. Governing Law</strong></h2><p>These Terms are governed by the laws of Pakistan. Any disputes arising from these Terms will be subject to the exclusive jurisdiction of courts in Karachi, Pakistan.</p><h3><strong>12.1 Dispute Resolution</strong></h3><p>We encourage resolving disputes through our customer support team. If formal resolution is needed, parties agree to attempt mediation before litigation.</p><h2><strong>13. Contact Information</strong></h2><p>For questions about these Terms and Conditions, please contact us:</p><p><strong>Email Support</strong></p><p>legal@skybooking.com</p><p><strong>Phone Support</strong></p><p>+92 21 1234 5678</p><p><strong>Mailing Address</strong></p><p>SkyBooking Private Limited<br>123 Travel Street<br>Karachi, Sindh 75500<br>Pakistan</p>', 'Terms & Conditions', 'Terms & Conditions', 'Terms & Conditions', 1, 0, 1, '2025-07-19 09:52:28', '2025-07-19 09:51:59', '2025-07-19 09:54:50'),
(2, 'Privacy Policy', 'privacy-policy', 'published', '<p>At SkyBooking, we are committed to protecting your privacy and ensuring the security of your personal information. This Privacy Policy explains how we collect, use, disclose, and safeguard your data when you use our website, mobile applications, and services.</p><p>By using our services, you consent to the practices described in this Privacy Policy. We encourage you to read this policy carefully and contact us if you have any questions.</p><h2><strong>1. Privacy Overview</strong></h2><p>This Privacy Policy applies to all users of SkyBooking\'s services and covers how we handle personal information across all our platforms and touchpoints.</p><h3><strong>1.1 Our Commitment</strong></h3><p>We are committed to:</p><ul><li>Protecting your personal information with industry-standard security measures</li><li>Being transparent about our data practices</li><li>Giving you control over your personal information</li><li>Complying with applicable privacy laws and regulations</li></ul><h3><strong>1.2 Scope</strong></h3><p>This policy covers our website, mobile applications, customer service interactions, and any other services we provide.</p><h2><strong>2. Information We Collect</strong></h2><p>We collect different types of information to provide and improve our services to you.</p><h3><strong>2.1 Personal Information You Provide</strong></h3><ul><li><strong>Account Information:</strong> Name, email address, phone number, date of birth</li><li><strong>Travel Information:</strong> Passport details, travel preferences, special requirements</li><li><strong>Payment Information:</strong> Credit card details, billing address (processed securely)</li><li><strong>Communication Data:</strong> Messages, reviews, customer service interactions</li></ul><h3><strong>2.2 Information Automatically Collected</strong></h3><ul><li><strong>Device Information:</strong> IP address, browser type, operating system</li><li><strong>Usage Data:</strong> Pages visited, search queries, booking patterns</li><li><strong>Location Data:</strong> Approximate location based on IP address</li><li><strong>Cookies &amp; Similar Technologies:</strong> See our Cookies section for details</li></ul><h3><strong>2.3 Information from Third Parties</strong></h3><ul><li>Travel service providers (airlines, hotels) for booking confirmations</li><li>Payment processors for transaction verification</li><li>Social media platforms if you choose to connect your accounts</li><li>Marketing partners for campaign effectiveness</li></ul><h2><strong>3. How We Use Information</strong></h2><p>We use your information for the following purposes:</p><h3><strong>3.1 Service Provision</strong></h3><ul><li>Processing and managing your bookings</li><li>Communicating about your travel arrangements</li><li>Providing customer support</li><li>Facilitating payments and refunds</li></ul><h3><strong>3.2 Platform Improvement</strong></h3><ul><li>Analyzing usage patterns to enhance user experience</li><li>Developing new features and services</li><li>Troubleshooting technical issues</li><li>Conducting research and analytics</li></ul><h3><strong>3.3 Marketing &amp; Communications</strong></h3><ul><li>Sending promotional offers and travel deals (with your consent)</li><li>Personalizing content and recommendations</li><li>Conducting customer satisfaction surveys</li><li>Informing you about service updates</li></ul><h3><strong>3.4 Legal &amp; Security</strong></h3><ul><li>Complying with legal obligations</li><li>Preventing fraud and ensuring platform security</li><li>Resolving disputes</li><li>Enforcing our terms and conditions</li></ul><h2><strong>4. Information Sharing</strong></h2><p>We share your information only in specific circumstances and with appropriate safeguards.</p><h3><strong>4.1 Service Providers</strong></h3><p>We share information with:</p><ul><li><strong>Travel Partners:</strong> Airlines, hotels, and other service providers to complete your bookings</li><li><strong>Payment Processors:</strong> To handle financial transactions securely</li><li><strong>Technology Providers:</strong> For hosting, analytics, and customer support</li><li><strong>Marketing Partners:</strong> For advertising and promotional activities (anonymized data only)</li></ul><h3><strong>4.2 Legal Requirements</strong></h3><p>We may disclose information when required by:</p><ul><li>Legal processes, court orders, or government requests</li><li>Law enforcement investigations</li><li>Protection of our rights, property, or safety</li><li>Prevention of fraud or illegal activities</li></ul><h3><strong>4.3 Business Transfers</strong></h3><p>In the event of a merger, acquisition, or sale of assets, your information may be transferred to the new entity, subject to this Privacy Policy.</p><h2><strong>5. Data Security</strong></h2><p>We implement comprehensive security measures to protect your personal information.</p><h3><strong>5.1 Technical Safeguards</strong></h3><ul><li>SSL/TLS encryption for data transmission</li><li>Encrypted data storage</li><li>Regular security audits and vulnerability assessments</li><li>Access controls and authentication systems</li></ul><h3><strong>5.2 Organizational Measures</strong></h3><ul><li>Employee training on data protection</li><li>Confidentiality agreements with staff and partners</li><li>Incident response procedures</li><li>Regular policy reviews and updates</li></ul><h3><strong>5.3 Payment Security</strong></h3><p>We are PCI DSS compliant and use tokenization to protect payment information. Credit card details are processed by certified payment processors and never stored on our servers.</p><h2><strong>6. Cookies &amp; Tracking Technologies</strong></h2><p>We use cookies and similar technologies to enhance your browsing experience.</p><h3><strong>6.1 Types of Cookies</strong></h3><ul><li><strong>Essential Cookies:</strong> Required for basic website functionality</li><li><strong>Performance Cookies:</strong> Help us understand how visitors use our site</li><li><strong>Functional Cookies:</strong> Remember your preferences and settings</li><li><strong>Marketing Cookies:</strong> Used to deliver relevant advertisements</li></ul><h3><strong>6.2 Cookie Management</strong></h3><p>You can control cookies through:</p><ul><li>Your browser settings</li><li>Our cookie preference center</li><li>Opt-out tools from advertising networks</li></ul><h4><strong>Cookie Preferences</strong></h4><p>Manage your cookie settings and learn more about how we use tracking technologies.</p><h2><strong>7. Your Privacy Rights</strong></h2><p>You have several rights regarding your personal information, depending on your location.</p><h3><strong>7.1 Access &amp; Portability</strong></h3><ul><li>Request a copy of your personal information</li><li>Receive your data in a portable format</li><li>Transfer your data to another service provider</li></ul><h3><strong>7.2 Correction &amp; Deletion</strong></h3><ul><li>Update or correct inaccurate information</li><li>Request deletion of your personal data</li><li>Withdraw consent for data processing</li></ul><h3><strong>7.3 Communication Preferences</strong></h3><ul><li>Opt out of marketing communications</li><li>Adjust notification settings</li><li>Choose communication channels</li></ul><h3><strong>7.4 How to Exercise Your Rights</strong></h3><p>Contact our Data Protection Officer at <a href=\"mailto:privacy@skybooking.com\">privacy@skybooking.com</a> or use your account settings to manage many of these preferences directly.</p><h2><strong>8. Data Retention</strong></h2><p>We retain your information only as long as necessary for the purposes outlined in this policy.</p><h3><strong>8.1 Retention Periods</strong></h3><ul><li><strong>Account Information:</strong> Until account deletion + 7 years for legal compliance</li><li><strong>Booking Data:</strong> 7 years for tax and legal requirements</li><li><strong>Payment Information:</strong> As required by payment card industry standards</li><li><strong>Communication Records:</strong> 3 years for customer service purposes</li></ul><h3><strong>8.2 Deletion Process</strong></h3><p>When retention periods expire, we securely delete or anonymize your information using industry-standard methods.</p><h2><strong>9. International Data Transfers</strong></h2><p>We may transfer your data internationally to provide our services effectively.</p><h3><strong>9.1 Transfer Safeguards</strong></h3><ul><li>Standard Contractual Clauses approved by regulatory authorities</li><li>Adequacy decisions for certain countries</li><li>Certification under recognized frameworks</li><li>Explicit consent where required</li></ul><h3><strong>9.2 Data Processing Locations</strong></h3><p>Your data may be processed in Pakistan, European Union, United States, and other countries where our service providers operate, always with appropriate safeguards.</p><h2><strong>10. Children\'s Privacy</strong></h2><p>Our services are not intended for children under 16 years of age.</p><h3><strong>10.1 Age Restrictions</strong></h3><ul><li>Users must be at least 16 years old</li><li>We do not knowingly collect information from children</li><li>Parents should supervise children\'s online activities</li></ul><h3><strong>10.2 If We Learn of Child Data</strong></h3><p>If we discover we have collected information from a child under 16, we will delete such information promptly.</p><h2><strong>11. Policy Updates</strong></h2><p>We may update this Privacy Policy to reflect changes in our practices or applicable laws.</p><h3><strong>11.1 Notification of Changes</strong></h3><ul><li>Email notification for significant changes</li><li>Website banner for 30 days after updates</li><li>Updated \"Last Modified\" date</li></ul><h3><strong>11.2 Continued Use</strong></h3><p>Your continued use of our services after policy updates constitutes acceptance of the revised terms.</p><h2><strong>12. Contact Us</strong></h2><p>For any privacy-related questions, concerns, or requests, please contact us:</p><p><strong>Data Protection Officer</strong></p><p>privacy@skybooking.com</p><p><strong>Privacy Hotline</strong></p><p>+92 21 1234 5679</p><p><strong>Privacy Office</strong></p><p>SkyBooking Private Limited<br>Data Protection Department<br>123 Travel Street<br>Karachi, Sindh 75500<br>Pakistan</p>', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', 1, 1, 1, '2025-07-19 09:54:50', '2025-07-19 09:54:50', '2025-07-19 09:54:50');
